"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[440],{97372:function(n){n.exports=JSON.parse('{"functions":[{"name":"CreateInstance","desc":"A utility for creating Instances. \\n\\n\\n```lua\\nlocal smokeyCube = CreateInstance(\\"BasePart\\", {\\n\\tName = \\"SmokeyCube\\",\\n\\tAnchored = true,\\n\\tSize = Vector3.new(4, 4, 4)\\n\\tParent = workspace\\n\\t[UIComponent.Children] = CreateInstance(\\"Smoke\\", {\\n\\t\\tSize = 4\\n\\t})\\n})\\n\\n-- ...which is equivalent to:\\nlocal smokeyCube = Instance.new(\\"BasePart\\")\\nsmokeyCube.Name = \\"SmokeyCube\\"\\nsmokeyCube.Anchored = true\\nsmokeyCube.Size = Vector3.new(4, 4, 4)\\nsmokeyCube.Parent = workspace\\n\\nlocal smoke = Instance.new(\\"Smoke\\")\\nsmoke.Size = 4\\nsmoke.Parent = smokeyCube\\n```\\n\\n### Assigning children\\n\\nAssigning children can be done within the CreateInstance function. The simplist way to do this is to simply pass a child:\\n\\n```lua\\nlocal gui = CreateInstance(\\"ScreenGui\\", {\\n\\tParent = PlayerGui,\\n\\n\\tChildren = CreateInstance(\\"Frame\\", {\\n\\t\\tSize = UDim2.new(0, 50, 0, 50),\\n\\t}),\\n})\\n```\\n\\nOr a table for multiple children:\\n```lua\\nlocal gui = CreateInstance(\\"ScreenGui\\", {\\n\\tParent = PlayerGui,\\n\\n\\tChildren = {\\n\\t\\tCreateInstance(\\"Frame\\", {\\n\\t\\t\\tSize = UDim2.new(0, 50, 0, 50),\\n\\t\\t}),\\n\\n\\t\\tCreateInstance(\\"TextButton\\", {\\n\\t\\t\\tSize = UDim2.new(0, 50, 0, 50),\\n\\t\\t}),\\n\\t}\\n})\\n```\\n\\nIf you ever need to, you can also specify multiple children under different keys using the `UIComponent.Children` Enum:\\n```lua\\nlocal gui = CreateInstance(\\"ScreenGui\\", {\\n\\tParent = PlayerGui,\\n\\n\\t[UIComponent.Children] = {\\n\\t\\tCreateInstance(\\"Frame\\", {\\n\\t\\t\\tSize = UDim2.new(0, 50, 0, 50),\\n\\t\\t}),\\n\\t}\\n\\n\\t[UIComponent.Children] = {\\n\\t\\tCreateInstance(\\"TextButton\\", {\\n\\t\\t\\tSize = UDim2.new(0, 50, 0, 50),\\n\\t\\t}),\\n\\t}\\n})\\n```","params":[{"name":"className","desc":"The class name of the Instance you want to create","lua_type":"string"},{"name":"props","desc":"The properties of the instance you want to create","lua_type":"table"}],"returns":[{"desc":"Returns a new Instance","lua_type":"Instance"}],"function_type":"static","source":{"line":155,"path":"lib/UIComponent/init.lua"}},{"name":"GetInstance","desc":"Returns the Instance returned by the component when it was built. This function will error if the component does not have an Instance.\\n\\n\\n```lua\\nlocal Button = UIComponent.new()\\n\\nfunction Button:Build()\\n\\treturn CreateInstance \\"TextButton\\" {\\n\\t\\tName = \\"FriendlyButton\\",\\n\\t\\tSize = UDim2.new(0, 100, 0, 50),\\n\\t\\tText = self.props.Text,\\n\\t}, self.props\\nend\\n\\nlocal newButton, _, props = Button {Text = \\"Hello World!\\"}\\nprint(newButton:GetInstance())\\nprint(props)\\n\\n> FriendlyButton\\n> {\\n\\tText = \\"Hello World!\\"\\n}\\n```","params":[],"returns":[{"desc":"","lua_type":"Instance"}],"function_type":"method","source":{"line":222,"path":"lib/UIComponent/init.lua"}},{"name":"Build","desc":"`Build` is called during the UIComponent\'s creation.\\n\\nBuild should **not** be called to create a new Instance of a UIComponent. Instead, call it like a function.\\n\\n\\n```lua\\n\\tlocal UIComponent = require(somewhere.UIComponent)\\n\\n\\tlocal PersistentGui = UIComponent.new()\\n\\n\\tfunction PersistentGui:Build()\\n\\t\\tself.gui = CreateInstance(\\"ScreenGui\\", {\\n\\t\\t\\tName = \\"PersistentGui\\",\\n\\t\\t\\tResetOnSpawn = false,\\n\\t\\t\\tZIndex = self.props.ZIndex,\\n\\t\\t\\tParent = LOCAL_PLAYER.PlayerGui\\n\\t\\t})\\n\\n\\t\\treturn self.gui, tick()\\n\\tend\\n\\n\\tlocal persistentGui, _, creationTime = MainGui.new{\\n\\t\\tZIndex = 3\\n\\t}\\n\\n\\tprint(\\"Created GUI at\\", creationTime)\\n```","params":[],"returns":[{"desc":"Returns the object and any provided arguments","lua_type":"self, ..."}],"function_type":"method","source":{"line":256,"path":"lib/UIComponent/init.lua"}},{"name":"Defer","desc":"`Defer` is called after `Build` and will not yield the thread.","params":[],"returns":[],"function_type":"method","source":{"line":262,"path":"lib/UIComponent/init.lua"}},{"name":"Is","desc":"Checks if the given object is a UIComponent object.","params":[{"name":"thing","desc":"Object to check","lua_type":"any"}],"returns":[{"desc":"`true` if object is a UIComponent.","lua_type":"boolean"}],"function_type":"static","source":{"line":272,"path":"lib/UIComponent/init.lua"}},{"name":"new","desc":"Creates a new UIComponent class.\\n\\n```lua\\n\\tlocal newComponent = UIComponent.new()\\n```","params":[],"returns":[{"desc":"","lua_type":"UIComponent"}],"function_type":"static","source":{"line":285,"path":"lib/UIComponent/init.lua"}}],"properties":[],"types":[],"name":"UIComponent","desc":"A UIComponent is a class for managing components of user interfaces.\\n\\nThis library is no longer maintained. I would suggest using Fusion instead.\\n\\n## Example\\n\\n```lua\\nlocal UIComponent = require(somewhere.UIComponent)\\nlocal CreateInstance = UIComponent.CreateInstance\\n\\nlocal LoudButton = UIComponent.new()\\n\\nfunction LoudButton:SetText(text)\\n\\tself.button.Text = text:upper()\\nend\\n\\nfunction LoudButton:Build()\\n\\tself.button = CreateInstance(\\"TextButton\\", {\\n\\t\\tSize = UDim2.new(0, 80, 0, 30),\\n\\t\\tText = self.props.text\\n\\t\\tParent = self.props.parent\\n\\t})\\n\\t\\n\\treturn self.button, self.SetText\\nend\\n\\nlocal screenGui = CreateInstance(\\"ScreenGui\\", {\\n\\tResetOnSpawn = false, \\n\\tParent = LOCAL_PLAYER.PlayerGui\\n})\\n\\nlocal button, _, UpdateText = LoudButton {text = \\"click me 10 times!\\", parent = screenGui}\\nlocal clicks = 0\\n\\nbutton.button.MouseButton1Click:Connect(function(clickCounter)\\n\\tclicks += 1\\n\\tUpdateText(button, button.props.text .. \\" \\" .. clicks)\\nend)\\n```","source":{"line":48,"path":"lib/UIComponent/init.lua"}}')}}]);